import Navbar from './partial/navbar';
import Foot from './footer';
import pic from '../img/bsea-logo.png';

function App() {
  return (
    <div className="App">

      <Navbar brandTitle="BSEA Cambodia" brandImg={pic}/>
      <Foot />
    </div>
  );
}

export default App;
